        content: "This is image 1"

    },
    {
        src: bg1,
        alt: "Image 1",
        title: "Image 1",
        content: "This is image 1"

    },
    {
        src: bg1,
        alt: "Image 1",
        title: "Image 1",
        content: "This is image 1"

    },
    {
        src: bg1,
        alt: "Image 1",
        title: "Image 1",
        content: "This is image 1"

    },
    bg1, bg2, bg3, bg4];

export default bgImages;
